import React from 'react';
import Container from 'react-bootstrap/Container';
import Image from 'react-bootstrap/Image';
import Button from 'react-bootstrap/Button';
import Robo from '../../assets/RoboMichaelangelo600.png';
import './index.css';


class HomePage extends React.Component{
    render() {
        return(
            <div>
                <Container className="mb-5">
                    <h1 className="hero-title">BUILD THE FUTURE</h1>
                    <div className="hero-description">
                        <p>As the world progresses faster and faster. Ceptier provides the tools and expertise to keep businesses in pace. Great insights produce a solid future.</p>
                    </div>
                    <button className="hero-btn">LEARN MORE</button>
                    <Image src={Robo} className="hero-img mx-auto" fluid />

                </Container>
                <section className="headline-section">
                    <Container>
                        <h1 className="text-center mt-5 mb-3">We Empower Growth Stage Businesses and Startups with our Enthusiatic Engineering Teams</h1>
                        <p className="text-center lead">We combine our many expertise to develop the right solution for you.</p>
                        <p className="text-center">Our end-to-end development expertise converts your vision into a powerful solution that drives company value.</p>
                    </Container>
                </section>


            </div>
        );
    }
}

export default HomePage;
